import React from 'react'

const Products = () => {
  return (
    <div className='w-full container flex mx-auto h-scr p-2 max-w-6xl flex-col'>
        <div className='font-semibold text-2xl mx-auto h-[20%] mt-3'>
            <span className=' w-full justify-center align-middle flex flex-col h-full '>Designed to supply all Brands</span>
            </div>
        <div>Brands</div>
        <div>Liquor displays</div>
    </div>
  )
}

export default Products
